async function CreatePeternakan(peternakan) {
  return fetch('http://127.0.0.1:8000/api/peternakan', {
    method: 'POST',
    dataType: "json",
    headers: {
      'Content-Type': 'application/json'
    },
    body: JSON.stringify(peternakan)
  })
  .then(data => data.json())
}

